import React from "react";

export default function SignIn() {
  const handleSubmit = (event) => {
    event.preventDefault();
  }

  return (
    <form action="/authenticate" method="POST" onSubmit={handleSubmit}>
      <fieldset>
        <label for="email">E-mail</label>
        <input for="email" type="email" name="email" inputmode="email" autocomplete="username" />
      </fieldset>
      <fieldset>
        <label for="password">Senha</label>
        <input for="password" type="password" name="password" autocomplete="current-password" />
      </fieldset>
      <button type="submit">Entrar</button>
    </form>
  )
}
